import React from 'react';

function InfoTooltip(props) {

    return (
      <div className="popup popup_type_tooltip tooltip popup_open">
        <form name="" onSubmit={props.onSubmit} className="popup__container">
          <button type="button" className="popup__button-close" onClick={props.onClose}></button>
          <img className={`tooltip__img ${!props.isLuck ? "tooltip__img_error" : ""}`}></img>
          <p className="tooltip__title">{props.isLuck ? "Вы успешно зарегистрировались!" : "Что-то пошло не так! Попробуйте ещё раз." }</p>   
        </form>
    </div>
)
}
export default InfoTooltip
